		var LogoAnim = lottie.loadAnimation({
			container: document.getElementById('logoanimation'),
			renderer: 'svg',
			loop: false,
			autoplay: true,
			animationData: logoAnimation
		});

		function onHover(element,id){
			const mouseTarget = document.getElementById(`${id}`);
			let lockFlag = true;
			mouseTarget.addEventListener("mouseenter", () =>  {
				element.play();
				if (lockFlag) {
					setTimeout(() => {element.stop() ; lockFlag = true;},element.getDuration(false)*1000);
				}
				lockFlag = false;
			});}
		function onClick(element,id){
			const mouseTarget = document.getElementById(`${id}`);
			let lockFlag = true;
			mouseTarget.addEventListener("mousedown", () =>  {
				element.play();
				if (lockFlag) {
					setTimeout(() => {element.stop() ; lockFlag = true;},element.getDuration(false)*1000);
				}
				lockFlag = false;
			});}

		onHover(LogoAnim,"logoanimation");
